UPDATE etfs_ativos_reais 
    SET dividends_12m = CASE symbol
        WHEN 'DIM' THEN 2.221 WHEN 'MINN' THEN 0.219 WHEN 'ZBK' THEN 0.57209916 WHEN 'MBB' THEN 0.9790000000000001 WHEN 'SMMD' THEN 0.9279999999999999 WHEN 'CATH' THEN 1.3439999999999999 WHEN 'QMOM' THEN 2.129 WHEN 'DBJP' THEN 7.991999999999999 WHEN 'MFUL' THEN 1.646 WHEN 'ESGA' THEN 0.633 WHEN 'GNOM' THEN 0.039 WHEN 'ILCV' THEN 1.681 WHEN 'PMIO' THEN 0.7 WHEN 'FLCC' THEN 0.055 WHEN 'PHDG' THEN 0.795 WHEN 'ELCV' THEN 0.193 WHEN 'XCOR' THEN 1.7600000000000002 WHEN 'IEMG' THEN 3.359 WHEN 'PSK' THEN 0.72 WHEN 'IQSU' THEN 0.5589999999999999
    END,
    updatedat = NOW()
    WHERE symbol IN ('DIM', 'MINN', 'ZBK', 'MBB', 'SMMD', 'CATH', 'QMOM', 'DBJP', 'MFUL', 'ESGA', 'GNOM', 'ILCV', 'PMIO', 'FLCC', 'PHDG', 'ELCV', 'XCOR', 'IEMG', 'PSK', 'IQSU');